    "PI- Why are the goonies dying on West Beach, Midway Atoll NWR: Hazmat or habitat?",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:16.016371",nt"name": "pi-why-are-the-goonies-dying-on-west-beach-midway-atoll-nwr-hazmat-or-habitat",nt"isopen":
    false,nt"url": null,nt"notes": "Analysis of long term monitoring data as
    well as analysis of data collected during the 2005/2006 Albatross breeding season
    show that nests located within long-term monitoring plots located on West Beach
    of Midway Atoll NWR have chronically poor reproductive success. In an effort to
    isolate the possible variables associated with reduced reproductive success, contamination
    was investigated as a factor. Contaminants were suspected to be a primary mechanism
    working silently alone or in conjunction with other environmental factors. Soil
    contamination (assumed to be the primary pathway of exposure) was found to be significantly
    lower in the West Beach plots so does not appear to be the driving factor for reduced
    reproductive success. Variations in habitat and human disturbance were assessed.
    Fluctuation in reproductive success across habitat types and human disturbance makes
    it difficult to identify any specific trends.",nt"license_title": "License
